import React from 'react';
import axios from 'axios';

function Home() {
    const handleLogout = async () => {
        try {
            await axios.get('http://localhost:3001/logout');
            // After successful logout, you may want to clear any local storage or state indicating user authentication
            // For example: localStorage.removeItem('token');
            window.location.href = "/"; // Redirect to the login page or any other desired page
        } catch (error) {
            console.error("Logout error:", error);
        }
    };

    return (
        <center>
            <h1>Welcome to home</h1>
            <button onClick={handleLogout}>Logout</button>
        </center>
    );
}

export default Home;
